//---- Public Functions ---------------------------------------------

function isomap_render_background() {

  var screen_pos;
  var bicycle_x = Math.floor(bicycle.pos_x);
  var bicycle_y = Math.floor(bicycle.pos_y);
  var start_tile_x = Math.max(0, bicycle_x - isomap.draw_radius);
  var start_tile_y = Math.max(0, bicycle_y - isomap.draw_radius);
  var end_tile_x = Math.min(isomap.width, bicycle_x + isomap.draw_radius);
  var end_tile_y = Math.min(isomap.height, bicycle_y + isomap.draw_radius);

  for (var j=start_tile_y; j < end_tile_y; j++) {
    screen_pos = map_to_screen(start_tile_x,j);

    for (var i=start_tile_x; i < end_tile_x; i++) {

      // tile 0 is reserved for empty/null space. The canvas background shows through.
      if (isomap.background[i][j] > 0) {
        tile_render(isomap.background[i][j], screen_pos.x, screen_pos.y);
      }

      screen_pos.x += TILE_WIDTH_HALF;
      screen_pos.y += TILE_HEIGHT_HALF;
    }
  }
}

function isomap_render_object() {
 
  var screen_pos;
  var bicycle_x = Math.floor(bicycle.pos_x);
  var bicycle_y = Math.floor(bicycle.pos_y);
  var start_tile_x = Math.max(0, bicycle_x - isomap.draw_radius);
  var start_tile_y = Math.max(0, bicycle_y - isomap.draw_radius);
  var end_tile_x = Math.min(isomap.width, bicycle_x + isomap.draw_radius);
  var end_tile_y = Math.min(isomap.height, bicycle_y + isomap.draw_radius);

  // draw bicycle outside map
  if (bicycle_x < 0 || bicycle_y < 0) bicycle_render();

  for (var j=start_tile_y; j < end_tile_y; j++) {
    screen_pos = map_to_screen(start_tile_x,j);

    for (var i=start_tile_x; i < end_tile_x; i++) {

      // tile 0 is reserved for empty/null space. The canvas background shows through.
      if (isomap.object[i][j] > 0) {
        tile_render(isomap.object[i][j], screen_pos.x, screen_pos.y);
      }

      if (i == bicycle_x && j == bicycle_y) {
        bicycle_render();
      }

      screen_pos.x += TILE_WIDTH_HALF;
      screen_pos.y += TILE_HEIGHT_HALF;
    }
  }

  // draw bicycle outside map
  if (bicycle_x >= isomap.width || bicycle_y >= isomap.height) bicycle_render();
  
}

function isomap_get_background(pos_x, pos_y) {
  if (pos_x >= 0 && pos_y >= 0 && pos_x < isomap.width && pos_y < isomap.height) {
    return isomap.background[pos_x][pos_y];
  }
  else return 0;
}

function isomap_get_object(pos_x, pos_y) {
  if (pos_x >= 0 && pos_y >= 0 && pos_x < isomap.width && pos_y < isomap.height) {
    return isomap.object[pos_x][pos_y];
  }
  else return 0;
}


